import React from 'react';

const TodoList = ({ todos, deleteTodo }) => (
  <List>
    {todos.map((todo, index) => (
      <ListItem key={index.toString()} dense button>
          <button className="button-save-journal" onClick={() => {
              deleteTodo(index);
            }}>Delete</button>
        </ListItem>
    ))};
  </List>
);

export default TodoList;
